if ($('#innerSearch').length) {
	var typingTimer;
	$('#innerSearch').keyup(function(e) {
		if (e.which == 18 || e.which == 37 || e.which == 38 || e.which == 39 || e.which == 40) {
			return false;
		}
		clearTimeout(typingTimer);
                if(e.which == 13){
                    if ($(this).val().length > 0) {
                            var url = '/?search_field=' + $(this).val();
                            typingTimer = setTimeout(function() {
                                    window.location.href = url;
                            }, 200);
                    }
                }
	}).autocomplete({
		limit: 15,
		source:[autocomplete]
	}).on('selected.xdsoft',function(e, data) {
		window.location.href = '/?search_field=' + data;
	});
}

$('.entry-content a').each(function() {
	var a = new RegExp('/' + window.location.host + '/');
	if (!a.test(this.href)) {
		$(this).click(function(event) {
			event.preventDefault();
			event.stopPropagation();
			window.open(this.href, '_blank');
		});
	}
});

(function($) {
	function detectIE() {
		var ua = window.navigator.userAgent;

		var msie = ua.indexOf('MSIE ');
		var trident = ua.indexOf('Trident/');
		var edge = ua.indexOf('Edge/');

		if (msie > 0 || trident > 0 || edge > 0) {
			jQuery('html').addClass('msie');
			return true;
		}

		return false;
	}

	detectIE();
	// getSerializedTracking("Unit42_Subscribe");
	$('form.subscribe-form').each(function(i, e) {
		var $this = $(e);                
		$this.submit(function() {
			console.log($this);
			var success = true;
			var form = $this;
			var mail = form.find('input[name="Email"]');

			if (mail.val() === '' || !isEmail(mail.val())) {
				mail.addClass('has-error');
				$('.error-mail').removeClass('d-none');
				success = false;
			} else {
				mail.removeClass('has-error');
				$('.error-mail').addClass('d-none');
			}

			if (!subscribeSuccess) {
				$('.error-recaptcha').removeClass('d-none');
			} else {
				$('.error-recaptcha').addClass('d-none');
			}

			if (success && subscribeSuccess) {
                                updateEmailMask();
				$('form.subscribe-form input[type="submit"]').hide();
				$('.sub-ajax-loader').removeClass('d-none');
				$.ajax({
					type: 'POST',
					url: form.attr('action'),
					data: form.serialize(),
					success: function(msg) {
                                                _satellite.track('email-subscribe-u42');
						$this.html('<p style="color: #B6D550;">You have been successfully subscribed</p>');
					}
				});
			}

			return false;
		});
	});

	$('[data-toggle="tooltip"]').tooltip();

	$('button.btn-menu').click(function() {
		$('body').toggleClass('menu-opened');
		$('nav.site-nav').stop(true).slideToggle(250);
	});

	// $('#subscribe-field').on('keydown keyup', function() {
	// 	if ($(this).val() !== '') {
	// 		$('.google-recapth').removeClass('d-none');
	// 	} else {
	// 		$('.google-recapth').addClass('d-none');
	// 	}
	// });

	$('.subscribe-field').each(function(i, e) {
		$(e).on('keydown keyup', function() {
			var capth = $(this).closest('form').find('.google-recapth');
			if ($(this).val() !== '') {
				capth.removeClass('d-none');
			} else {
				capth.addClass('d-none');
			}
		});
	});

	function isEmail(email) {
		var re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
		return re.test(String(email).toLowerCase());
	}

	$('#commentform').submit(function() {
		var success = true;
		var required = $(this).find($('[required]'));

		required.removeAttr('style');

		required.each(function(i, e) {
			if ($(e).val() === '') {
				success = false;
				$(e).css('border', '1px solid red');
			} else if ($(e).attr('type') === 'email' && !isEmail($(e).val())) {
				success = false;
				$(e).css('border', '1px solid red');
			}
		});

		return success;
	});
}(jQuery));
function updateEmailMask() {
    let email = $("input[name='Email']").val();                
     if (email && email.trim() != '') {                    
        let maskedEmail = maskEmailAddress(email);
        console.log("maskedEmail:", maskedEmail);
        $("input[name='emailFormMask']").val(maskedEmail);                                      
     }                 
}
function maskEmailAddress (emailAddress) {
    function mask(str) {
        var strLen = str.length;
        if (strLen > 4) {
            return str.substr(0, 1) + str.substr(1, strLen - 1).replace(/\w/g, '*') + str.substr(-1,1);
        } 
        return str.replace(/\w/g, '*');
    }
    return emailAddress.replace(/([\w.]+)@([\w.]+)(\.[\w.]+)/g, function (m, p1, p2, p3) {      
        return mask(p1) + '@' + mask(p2) + p3;
    });
    return emailAddress;
}

//Maintain Heading Element Sequence according page for SEO purpose
$(document).ready(function(){
	
	  if(window.location.href.indexOf("author") > -1 || window.location.href.indexOf("tag") > -1 || window.location.href.indexOf("category") > -1 || window.location.href.indexOf("atoms") > -1 || window.location.href.indexOf("tools") > -1) {
          var elements = document.getElementsByClassName('news__title');
		  for (let i = 0; i < elements.length; i++) {
		   $(elements[i]).replaceWith(function() {
  return '<h2 class="h5 news__title mb-15">' + $(this).html() + '</h2>';
      });
		 }
		 
		 var footerelement = document.getElementsByClassName('widget_nav_menu');
		 for (let j = 0; j < footerelement.length; j++) {
		   $(footerelement[j]).find('h4').replaceWith(function() {
  return '<h3 class="h6 mb-15 font-weight-black">' + $(this).html() + '</h3>';
      });
		 }
      }
});
